 **From line 13718 in three.js**
```javascript
setFromPoints: function ( points ) {

	var position = [];

	for ( var i = 0, l = points.length; i < l; i ++ ) {

		var point = points[ i ];
		position.push( point.x, point.y, point.z || 0 );

	}

	this.addAttribute( 'position', new Float32BufferAttribute( position, 3 ) );

	return this;

}
 ```
